import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';
import { 
  BookOpen, 
  FileText, 
  HelpCircle, 
  Users, 
  BarChart3,
  Plus,
  Edit,
  Trash2,
  Settings
} from 'lucide-react';
import './AdminDashboard.css';

function AdminDashboard() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [stats, setStats] = useState(null);
  const [modules, setModules] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('overview');

  useEffect(() => {
    if (!user || !user.is_admin) {
      navigate('/');
      return;
    }
    loadData();
  }, [user, navigate]);

  const loadData = async () => {
    try {
      const [statsRes, modulesRes] = await Promise.all([
        axios.get('/api/admin/stats'),
        axios.get('/api/admin/modules')
      ]);
      setStats(statsRes.data);
      setModules(modulesRes.data);
    } catch (error) {
      console.error('Error loading admin data:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleDeleteModule = async (moduleId) => {
    if (!window.confirm('Are you sure you want to delete this module? This will also delete all associated sections, questions, and content.')) {
      return;
    }
    try {
      await axios.delete(`/api/admin/modules/${moduleId}`);
      loadData();
    } catch (error) {
      alert(error.response?.data?.error || 'Failed to delete module');
    }
  };

  if (loading) {
    return <div className="admin-loading">Loading admin dashboard...</div>;
  }

  return (
    <div className="admin-dashboard">
      <div className="admin-header">
        <h1>Admin Panel</h1>
        <div className="admin-tabs">
          <button 
            className={activeTab === 'overview' ? 'active' : ''}
            onClick={() => setActiveTab('overview')}
          >
            Overview
          </button>
          <button 
            className={activeTab === 'modules' ? 'active' : ''}
            onClick={() => setActiveTab('modules')}
          >
            Modules
          </button>
        </div>
      </div>

      {activeTab === 'overview' && (
        <div className="admin-overview">
          <div className="stats-grid">
            <div className="stat-card">
              <Users className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.total_users || 0}</h3>
                <p>Total Users</p>
              </div>
            </div>
            <div className="stat-card">
              <BookOpen className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.total_modules || 0}</h3>
                <p>Modules</p>
              </div>
            </div>
            <div className="stat-card">
              <FileText className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.total_sections || 0}</h3>
                <p>Sections</p>
              </div>
            </div>
            <div className="stat-card">
              <HelpCircle className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.total_questions || 0}</h3>
                <p>Questions</p>
              </div>
            </div>
            <div className="stat-card">
              <BarChart3 className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.total_content || 0}</h3>
                <p>Learning Content</p>
              </div>
            </div>
            <div className="stat-card">
              <Settings className="stat-icon" />
              <div className="stat-content">
                <h3>{stats?.admin_count || 0}</h3>
                <p>Admins</p>
              </div>
            </div>
          </div>

          <div className="quick-actions">
            <h2>Quick Actions</h2>
            <div className="action-buttons">
              <button onClick={() => navigate('/admin/modules/new')} className="action-btn">
                <Plus /> Create New Module
              </button>
              <button onClick={() => setActiveTab('modules')} className="action-btn">
                <Edit /> Manage Modules
              </button>
              <button onClick={() => navigate('/admin/users')} className="action-btn">
                <Users /> Manage Users
              </button>
            </div>
          </div>
        </div>
      )}

      {activeTab === 'modules' && (
        <div className="admin-modules">
          <div className="modules-header">
            <h2>Modules Management</h2>
            <button onClick={() => navigate('/admin/modules/new')} className="btn-primary">
              <Plus /> Create Module
            </button>
          </div>
          <div className="modules-list">
            {modules.map(module => (
              <div key={module.id} className="module-card">
                <div className="module-info">
                  <h3>{module.display_name}</h3>
                  <p>{module.description || 'No description'}</p>
                  <div className="module-stats">
                    <span>{module.section_count} sections</span>
                    <span>{module.question_count} questions</span>
                  </div>
                </div>
                <div className="module-actions">
                  <button 
                    onClick={() => navigate(`/admin/modules/${module.id}`)}
                    className="btn-edit"
                  >
                    <Edit /> Edit
                  </button>
                  <button 
                    onClick={() => handleDeleteModule(module.id)}
                    className="btn-delete"
                  >
                    <Trash2 /> Delete
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}

export default AdminDashboard;
